import React from 'react';
import styled from '@emotion/styled';
import { BsChevronDown, BsChevronUp } from 'react-icons/bs';

const SortPanel = () => {
  return (
    <SortPanelStyled>
      <div className='sort'>
        <div>
          <BsChevronDown />
        </div>
        <div>
          <BsChevronUp />
        </div>
      </div>
    </SortPanelStyled>
  );
};

const SortPanelStyled = styled.div`
  ${({ theme }) => theme.flex.between};
  height: 50px;
  border: 3px solid red;
  border-radius: 50px;
  padding: 0 30px;
  margin-bottom: 50px;

  .sort {
    display: flex;
    div {
      svg {
        width: 40px;
        height: 40px;
      }
    }
  }
`;

export default SortPanel;
